Since I generally don't know what I'm doing, I tend to read many blogs and watch technology streams to discover techniques in areas that I'm unfamiliar with - like Fuzzing! Gynvael's YouTube channel has loads of resources on fuzzing and is a great resource for learning more. In his intro to fuzzing stream, he mentions "Magic Numbers" in files that are ripe for manipulation. The numbers are chosen based on the propensity for errors like integer underflow or overflow to result from changing their values. 0xFF 0x7F 0x00 0xFFFF 0x0000 0xFFFFFFFF 0x00000000 0x80000000 (Minimum 32-bit integer) 0x40000000 (1/2 Min 32-bit integer) 0x7FFFFFFF (Maximum 32-bit integer) For example, if 0x7FFFFFFF is chosen as the value to replace, we'll have to replace the first byte with 0x7F and then each subsequent byte with 0xFF for a total of 4 bytes in length. We'll construct a mapping for these values in a slice of int slices, and then pick a set at random to tell us what to change in the input data. // Gynvael's magic numbers https://www.youtube.com/watch?v=BrDujogxYSk&
magicVals := [][]int{ {1, 255}, {1, 255}, {1, 127}, {1, 0}, {2, 255}, {2, 0}, {4, 255}, {4, 0}, {4, 128}, {4, 64}, {4, 127},
} pickedMagic := magicVals[rand.Intn(len(magicVals))]
index := rand.Intn(len(data) - 8) We'll then just hard-code our values into a switch statement to change the input data according to the value selected: // Hardcode byte overwrites for tuples beginning with (1, ) if pickedMagic[0] == 1 { switch pickedMagic[1] { case 255: data[index] = 255 case 127: data[index+1] = 127 case 0: data[index] = 0 } // Hardcode byte overwrites for tuples beginning with (2, ) } else if pickedMagic[0] == 2 { switch pickedMagic[1] { case 255: data[index] = 255 data[index+1] = 255 case 0: data[index] = 0 data[index+1] = 0 } // Hardcode byte overwrites for tuples beginning with (4, ) } else if pickedMagic[0] == 4 { switch pickedMagic[1] { case 255: data[index] = 255 data[index+1] = 255 data[index+2] = 255 data[index+3] = 255 case 0: data[index] = 0 data[index+1] = 0 data[index+2] = 0 data[index+3] = 0 case 128: data[index] = 128 data[index+1] = 0 data[index+2] = 0 data[index+3] = 0 case 64: data[index] = 64 data[index+1] = 0 data[index+2] = 0 data[index+3] = 0 case 127: data[index] = 127 data[index+1] = 255 data[index+2] = 255 data[index+3] = 255 } } return data
}

