Now for the real meat of the fuzzer. We need to feed the program our mutated file, and keep track of inputs that cause significant crashes. A significant crash in this case would be writing to memory outside of the range of the program, or a segmentation fault. To easily capture the error output of a faulting instance of exif, we wrap the command in a bash -c command, and execute it with Go using the os/exec package. We then direct the stderr from the command to our buffer to analyze the output. // Run command, capture output
var output bytes.Buffer
exifCommand := "/bin/bash"
cmd := exec.Command(exifCommand, "-c", "./exif/bin/exif ./mutated.jpg -verbose")
cmd.Stderr = &output
err := cmd.Start()
check(err) We make sure to include a counter value in our wrapper program so we can determine which run created which error. If we find an iteration has exited in error, we check our error buffer for evidence of a segfault. When we find a segfault, write the input data as a jpg, labeled with the fuzzing iteration. // Write any crashes to file
if err := cmd.Wait(); err != nil { if exitError, ok := err.(*exec.ExitError); ok { // Check if error is a segfault if strings.Contains(exitError.String(), "segmentation") { // Write falt-causing `data` to jpg file, label with `counter` fmt.Printf("%d - %s\n", counter, exitError) err = ioutil.WriteFile(fmt.Sprintf("./crashes/crash.%d.jpg", counter), data, 0644) check(err) } }
} // Print `counter` as status updates
if counter%100 == 0 { fmt.Println(counter)
